INSERT INTO `f_a_qs` (`id`, `question_ar`, `question_en`, `answer_ar`, `answer_en`, `created_at`, `updated_at`) VALUES
(1, 'ما هو فارماشير؟', 'ًWhat is PHARMASHARE all about?', 'فارما شير هو اول موقع مرخص لتجارة الادويه اونلاين بين المؤسسات الصيدلانية', 'It offers an official online merchandising hub to facilitate communication between pharmaceutical institute.', NULL, '2019-08-20 14:35:42'),
(2, 'ما هي شروط الاشتراك في الموقع؟', 'What is the main condition of registration and membership?', 'ان تكون مؤسسة  او صيدلي مرخص', 'To be a licensed /Registered Pharmacy , store, agent or a pharmacist', NULL, '2019-08-20 13:38:56'),
(3, 'ما هي الاوراق المطلوبة عند التقديم؟', 'What are the document required upon registration?', 'الرخصة التجارية \r\nرخصة وزارة الصحة \r\nاو شهادة التخرج مع الهوية الشخصيه', 'Your trade license / MOH,DHA or HAAD  license/ Pharmacy graduate certificate/ National ID', NULL, '2019-08-20 13:54:32'),
(4, 'ما هي الخدمات التي يقدمها فارما شير', 'What are the services offered by Pharmashare', 'يوفر فارما شير بيئة تجارية آمنة لتجارة الادوية و المستحضرات الطبية المسجلة في دولة الامارات العربية المتحدة\r\nمن الخصائص و الخدمات المقدمة في الموقع:\r\nالبحث بالاسم العلمي و التجاري\r\nتحديد مواقع المؤسسات الصيدلانية على الخريطة\r\nالتواصل بين الاعضاء و المؤسسات الصيدلانية عبر الشات \r\nاضافة مستحضر طبي من قبل المخازن في حال عدم تواجده في القائمة\r\nالتبضع من عدة مخازن في نفس الوقت \r\nاضافة اعلانات للتسويق او وظائف \r\nايجاد مراجع طبية /كورسات بساعات معتمدة', 'Safe medical  merchandising environment  for registered medicine/items in UAE through the following services\r\n- Looking up for medication by generic /Brand names\r\n-Being updated by latest pricing /offers.\r\n- Locating your customers on Map.\r\n- online chatting between members for better communication.\r\n- Adding a new registered medical items/supplies/cosmetics.(if not available)\r\n- Purchasing from different stores at the same time.\r\n- Creating & publishing an advertisement on your own or with admin support.\r\n-Finding medical references /courses /CMEs.', NULL, '2019-08-20 14:34:29');
